import './css/SearchBarComponent.css';
import React from 'react';

export class SearchBarComponent extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            guess_val: ""
        }
    }

    render() {
        return (
            <div>
            <div class="box">
                <form name="search">
                    <input type="text" style={{caretColor: 'transparent'}} id='search' class="input" name="txt" onMouseOut={(e) => this.blurVal(e)} />
                    <i class="search_uncursor">Search here</i>
                </form>
            </div>
            </div>
        )
    }

    blurVal(e) {
        e.preventDefault();
        document.getElementById('search').value = "";
    }

}
